import React from 'react';
import Page from './components/Page';
import client from "./metier/client";
var clients = [];

function App() {
    fetch("http://localhost:8080/api/clients")
        .then(res => res.json())
        .then(
            (result) => {
                const clients = [];
                result.forEach(function (c) {
                    clients.push(new client(c));
                });
                this.setState({
                    initialized: true,
                    listeClients: clients
                });
            },
            (error) => {
                this.setState({
                    initialized: true,
                    error: error
                });
            }
        );
    return (
        <div className="App">
            <Page/>
        </div>
    );
}
export default App;
